import React from 'react'; 
import { Container, Row, Column, Heading } from 'rebass'; 
const Home = () => { 
  return ( 
    <Container> 
      <Row> 
        <Column> 
          <Heading>This is home</Heading> 
        </Column> 
      </Row> 
    </Container> 
  ); 
}; 
export default Home;
